import React, { useState, useEffect } from 'react';
import './media-queries.css';
import { NavLink } from 'react-router-dom';

function Menu() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
      };
    return (
        <>
        <button className="menu" onClick={toggleMenu}>Menu</button>
            <div className={`mobile-menu ${isMenuOpen ? 'open' : ''}`}>
                <div className='mobie-content'>
                <NavLink onClick={toggleMenu} className="link">back</NavLink>
            <NavLink to="/features" className="link">
              Features
            </NavLink>
            <NavLink to="/ourplan" className="link">
              Our Plan
            </NavLink>
            <NavLink to="/feedback" className="link">
              Feedback
            </NavLink>
            <NavLink to="/contact" className="link">
              Contact Us
            </NavLink>
            <NavLink to="/donation" className="link">
              Donations
            </NavLink>
                </div>
            </div>
            </>
    );
}
export default Menu;
